import Header from '../components/Header';
import Navbar from '../components/navbar/navbar';
import Homepage from '../components/homepage/splashPage';
import '../components/style.css';

const Home = () => (
    <div>
        <Header />
        <Navbar />
        <Homepage />
    </div>
)

export default Home;
